import React from 'react';

const ShortenButton = ({ onClick, isLoading }) => {
    return (
        <button onClick={onClick} disabled={isLoading}>
            {isLoading ? 'Shortening...' : 'Shorten URL'}
        </button>
    );
};

export default ShortenButton;
